----------------------------------------------------------------------------
-- BEGIN CREATING TABLES
----------------------------------------------------------------------------

CREATE TABLE baselayer(
	id INT NOT NULL, 
	brand varchar(20) NULL,
	[type] varchar(20) NULL,
	[name] varchar(100) NULL,
	isdefault BIT NULL,
	numzoomlevels INT NULL,
	CONSTRAINT [PK_baselayer] PRIMARY KEY CLUSTERED (id ASC)
) ON [PRIMARY]

CREATE TABLE layergroup(
	id INT NOT NULL,
	name varchar(50) NULL,
	url varchar(300) NULL,
	CONSTRAINT [PK_layergroup] PRIMARY KEY CLUSTERED (id ASC)
) ON [PRIMARY]

CREATE TABLE layer(
	id INT NOT NULL,
	layergroup INT NULL,
	prefix varchar(15) NULL,
	layers varchar(50) NULL,
	name varchar(50) NULL,
	[type] varchar(20) NULL,
	url varchar(200) NULL,
	abstract varchar(500) NULL,
	numzoomlevels INT NULL,
	CONSTRAINT [PK_layer] PRIMARY KEY CLUSTERED (id ASC),
	CONSTRAINT [FK_layer_layergroup] FOREIGN KEY (layergroup) REFERENCES layergroup (id)
) on [PRIMARY]

CREATE TABLE icon(
	id INT NOT NULL,
	name varchar(255),
	url varchar(1000),
	CONSTRAINT [PK_icon] PRIMARY KEY CLUSTERED (id ASC)
) on [PRIMARY]

CREATE TABLE iconstolayers(
	id INT NOT NULL,
	iconid INT NULL,
	layer varchar(100),
	CONSTRAINT [PK_iconstolayers] PRIMARY KEY CLUSTERED (id ASC),
	CONSTRAINT [FK_iconstolayers_icon] FOREIGN KEY (iconid) REFERENCES icon(id)
) ON [PRIMARY]

CREATE TABLE config(
	id INT NOT NULL,
	component varchar(30) NULL,
	name varchar(50) NULL,
	value varchar(200) NULL,
	description varchar(200) NULL,
	CONSTRAINT [PK_config] PRIMARY KEY CLUSTERED (id ASC)
) on [PRIMARY]

GO

----------------------------------------------------------------------------
-- VIEWS
----------------------------------------------------------------------------

CREATE VIEW iconmaster AS
	SELECT
		icon.id,
		icon.name,
		icon.url,
		iconstolayers.layer
	FROM
		icon
		INNER JOIN iconstolayers
		ON icon.id = iconstolayers.iconid
	

GO


